column882:
08/Aug/25 5:46 PM;devi.jampana@vodafone.com;Comment from Tobias:

When a customer is opened in OSF and has inventory devices, these must be send to BLES for the rule execution. There was currently a refactoring on how these are send from VkdGateway. The new interface is described here:
[https://de.confluence.agile.vodafone.com/spaces/PORTALS/pages/644318331/Interface+between+BLES+and+VKD+Gateway+IBP]

BLES expects that the $deviceType in the new device format is 'UNIVERSAL' and the deviceSpecifications are delivered in the $supportedFeatures array.
However, the $deviceType field is still send in the old format ("CABLEMODEM") while the $supportedFeatures array already contains the new format – as a result, BLES tries to interpret the new features in the old way, leading to wrong results:
{quote}"installedBaseServiceLines": [
{
"hardware": {
"devices": [
{
"enabledFeatures":
Unknown macro: \{ "maxDownstreamBandwidth"}
,
{color:#FF0000}"deviceType": "CABLEMODEM",{color}
"equipmentType": "UNITYMEDIA",
"ownership": "lease",
"supportedFeatures":
Unknown macro: \{ "MAX_DOWNSTREAM_BANDWIDTH"}
,
"legacyLocation": "IN1",
"cancellationInformation": null
}
]
},
{quote}
The result is that we probably try to swap modems for customer who would not actually need modems to be swapped – or rather before that, the orders fail because IBP and OSF disagree on what should happen and a Sky Force ticket is created.

I think Team Pyramid should have a look here.;;;

column885:
