column885:
07/Jun/25 4:37 PM;ajay.yashwantbhavar@vodafone.com;We have observed that whenever an OSF order fails in KIAS for any reason, KIAS is not sending the OGWOrderLineID (OGWSubscriberId - IETRX_P3 "EXT_SUB_ID") in the set order status response towards OGW. Due to this issue, OGW is unable to identify for which order package they need to update the response. As a result, they are updating the response for both packages due to which Postpaid order details are shown in Prepaid package (In case of Multipackage scenario).We have observed ietrx_p3 id is empty in ie_transactions table in case of failure scenario.

Mail sent to [~katarina.poltakova@vodafone.com] for further check.

 ;;;

column886:
11/Jun/25 2:18 PM;ariadne.thun1@vodafone.com;I assume based on the last analysis from Mirel we have to assign to Amdocs right?



I double checked current Production status for the last 7 days – for IETRX_P4 = ‘ACTERR’, KIAS does not send a value in IETRX_P3 field.

For all other values in IETRX_P4, KIAS sends a value in IETRX_P3, but not for ACTERR, and this makes sense, as the error (data validation, exception, or final exception) impacts the whole order, and not specific subscribers in the order.So, please check why OGW behavior changed with BSS46. We need this analysis asap, otherwise it will fail in Production from 22.06.;;;

