column880:
04/Jul/24 6:28 PM;rohan.kumbhar@vodafone.com;As per the latest call on BEW topic.. there is a design GAP for the BEW flows which needs to be discussed by VF Design team.
as of now the problem here for this flow is that in the GetCustomerDetails Mode 3 call Omnius is always receiving BEWVersion as "0" irrespective of any other version is sent from OSF. So there is no checks nor validation of this BEW version at legacy backend and everytime Cable/UM will send Version 0 only.
So this is a design gap and currently this defect needs to be kept ON_HOLD until further clarification;;;

